import MUIDataTable from 'mui-datatables'

const columns = [
	{
		name: 'user_id',
		label: 'User ID',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'app_id',
		label: 'App ID',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'total_amount',
		label: 'Total Amount'
	}
]

const options = {
	filterType: 'checkbox'
}

const UserPayApp = ({ data }) => {
	return <MUIDataTable title={'User Pay App'} data={data} columns={columns} options={options} />
}

export default UserPayApp
